import "./eventList.css";
import useFetch from "../../hooks/userFetch";

const EventList = () => {
  const { data, loading, error } = useFetch("/event/countByType");
  const images = [
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
  ];
  return (
    <div>
      {loading ? (
        "loading"
      ) : (
        <>
          {" "}
          {data &&
            images.map((img, i) => (
              <div class="container">
                <div class="row">
                  <article class="col-md-4 col-lg-3">
                    <div class="card-content">
                      <a class="spectrum-a" href="http://uj.ac.za">
                        <img class="spectrum1" src={img} alt="meow" />
                        <h4 class="spectrum-h2">Spectrum</h4>
                        <p>
                          Visit our world-class analytical facility for South
                          African scientists, Spectrum
                        </p>
                      </a>
                    </div>
                  </article>
                </div>
              </div>
            ))}
        </>
      )}
    </div>
  );
};
export default EventList;
